import React, { Component } from 'react';
import '../../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Profile from "../../component/Profile";
import Video from "../../component/Video";
import Card from "../../component/Card";
import Terms from "../../component/Terms";
import { UpdateUserProfile } from './services'
import Swal from 'sweetalert2';

class Welcome extends Component {
  constructor (props) {
    super(props)
    this.state = {
      currentStep: null,
      firstname: "",
      lastname: "",
      email: "",
      phone: "",
      safteyVideo: false,
      terms: false,
      terms: false,
      disableNext: false
    }
    this.handleChange = this.handleChange.bind(this);
    this.handleVideoEnd = this.handleVideoEnd.bind(this);
    this.handleVideoStart = this.handleVideoStart.bind(this);
    this._next = this._next.bind(this);
    this._prev = this._prev.bind(this);
  }
  handleChange(event) {
    console.log(event.target)
    const { name, value } = event.target;
    this.setState({
      [name]: value
    });
    console.log({[name]: value})
  }

  handleVideoEnd() {
    console.log('handleVideoEnd')
    this.setState({
      disableNext: false
    });
  }

  handleVideoStart() {
    console.log('handleVideoStart')
    this.setState({
      disableNext: true
    });
  }
  
  handleSubmit = event => {
    event.preventDefault();
    const { email, username, password, terms} = this.state;
    alert(`Your registration detail: \n 
      Email: ${email} \n 
      Username: ${username} \n
      Password: ${password}`);
  };

  _next() {
    let currentStep = this.state.currentStep;

    // If the current step is 1 or 2, then add one on "next" button click
    currentStep = currentStep >= 3 ? 4 : currentStep + 1;
    this.setState({
      currentStep: currentStep
    });
  }

  _prev() {
    let currentStep = this.state.currentStep;
    // If the current step is 2 or 3, then subtract one on "previous" button click
    currentStep = currentStep <= 1 ? 1 : currentStep - 1;
    this.setState({
      currentStep: currentStep
    });
  }

  get previousButton() {
    let currentStep = this.state.currentStep;

    // If the current step is not 1, then render the "previous" button
    if (currentStep !== 1) {
      return (
         <div className=''>
        <a color="secondary float-left" className='wizard-content previous'  onClick={this._prev}>
          Previous
        </a>
        </div>
      );
    }

    // ...else return nothing
    return null;
  }

  get nextButton() {
    let currentStep = this.state.currentStep;
    // If the current step is not 3, then render the "next" button
    if (currentStep < 4) {
      return (
        <div className=''>
           <a color="primary float-right" className='wizard-content' onClick={ this.state.disableNext ? '' : this._next}>
            Next
          </a>
        </div>
       
      );
    }
    // ...else render nothing
    return null;
  }

  get submitButton() {
    let currentStep = this.state.currentStep;
    // If the current step is the last step, then render the "submit" button
    if (currentStep > 3) {
      return <a onClick={this.saveChanges} color="primary float-right" className='wizard-content'>Submit</a>;
      // href='/membership-completed'
    }
    // ...else render nothing
    return null;
  }

  saveChanges =  async () => {
    const { firstname, lastname, phone, email, photo } = this.state
    const data = {
      firstname: firstname,
      lastname: lastname,
      cell: phone,
      email: email,
      photo: photo,
      safteyVideo: 1,
      terms: 1
    }
    var userProfile = await UpdateUserProfile(data)
    if(userProfile.data.error) {
      Swal.fire({
        icon: 'error',
        title: 'OOPS',
        text: userProfile.data.msg,
        showConfirmButton: false,
        timer: 1500
      })
    } else {
      window.location.href = '/membership-completed';
    }
  }

  componentDidMount () {
    this.setState({ currentStep: 1 })
  }

  onChange = (key, value) => {
    this.setState({
        [key]: value
    });
  }

  render () {
    return (
      <div class="page-wraper account-body accountbg wizards">
        <div class="container">
          <div class="row  d-flex justify-content-center">
            <div class="col-12 align-self-center">
              <div class="row shadow">
                <div class="col-lg-6 p-a0">
                  <div class="form-section align-self-center">
                    <div class="login-title">
                      <div class="text-center formlogo">
                        <a href="index.html" class="logo logo-admin">
                          <svg xmlns="http://www.w3.org/2000/svg" width="1102" height="396" viewBox="0 0 1102 396" class="newlogo">
                            <defs>
                              <clipPath id="clip-newlogo">
                                <rect width="1102" height="396"/>
                              </clipPath>
                            </defs>
                            <g id="newlogo" clip-path="url(#clip-newlogo)">
                              <g id="Group_23" data-name="Group 23" transform="translate(34.047)">
                                <g id="Group_22" data-name="Group 22" transform="translate(-209.947 -27.9)">
                                  <circle id="Ellipse_2" data-name="Ellipse 2" cx="178.031" cy="178.031" r="178.031" transform="translate(221.9 49.414)" fill="#01284d"/>
